INSERT INTO `yyg_articles` VALUES ('19', '2', '了解云购', '', '1', '<p>	</p><p class=\"textindent\">1元云购是一种新型的网购模式，只需1元就有可能买到一件商品。1元云购网把一件商品平分成若干“等份”出售，每份1元，当一件商品所有“等份”售出后抽出一名幸运者，该幸运者即可获得此商品。</p><p>	</p><h3>规则：</h3><p>	</p><p>	1、每件商品参考市场价平分成相应“等份”，每份1元，1份对应1个云购码。	2、同一件商品可以购买多次或一次购买多份。	3、当一件商品所有“等份”全部售出后计算出“幸运云购码”，拥有“幸运云购码”者即可获得此商品。	4、幸运云购码计算方式：	</p><p style=\"text-indent:-1em; padding-left:36px;\">1）取该商品最后购买时间前网站所有商品100条购买时间记录（限时揭晓商品取截止时间前网站所有商品100条购买时间记录）。</p><p>	</p><p style=\"text-indent:1.6em;\">2）时间按时、分、秒、毫秒依次排列组成一组数值。</p><p>	</p><p style=\"text-indent:1.6em;\">3）将这100组数值之和除以商品总需参与人次后取余数，余数加上10,000,001即为“幸运云购码”。</p><p>	</p><p>	</p><h3>流程：</h3><p>	</p><p>	<strong>1、挑选商品</strong>	</p><p style=\"margin-bottom:15px; margin-top:5px;\">分类浏览或直接搜索商品，点击“立即1元云购”。</p><p>	<strong>2、支付1元</strong>	</p><p style=\"margin-bottom:10px; margin-top:5px;\">通过在线支付平台，支付1元即购买1人次，获得1个“云购码”。同一件商品可购买多次或一次购买多份，购买的“云购码”越多，获得商品的几率越大。</p><p>	<strong>3、揭晓获得者</strong>	</p><p style=\"margin-bottom:15px; margin-top:5px;\">当一件商品达到总参与人次，抽出1名商品获得者，1元云购网会通过手机短信或邮件通知您领取商品。</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;	</p><h3 style=\"padding-left:22px; margin-top:0;\">注：</h3><p style=\"margin-bottom:10px; margin-top:5px; text-indent:1.6em;\">1）商品揭晓后您可登录&quot;我的1元云购&quot;查询详情，未获得商品的用户不会收到短信或邮件通知；</p><p style=\"margin-bottom:10px; margin-top:5px; text-indent:1.6em;\">2）商品揭晓后，请及时登录&quot;我的1元云购&quot;完善个人资料，以便我们能够准确无误地为您配送商品。</p><p style=\"margin-bottom:10px; margin-top:5px; text-indent:1.6em;\">3）所有已揭晓商品均不给予退款</p><p><strong>4、晒单分享</strong><br/>	</p><p style=\"margin-top:5px;\">晒出您收到的商品实物图片甚至您的靓照，说出您的云购心得，让大家一起分享您的快乐。</p><p>	</p><p>在您收到商品后，您只需登录网站完成晒单，并通过审核，即可获得400-1500福分奖励。在您成功晒单后，您的晒单会出现在网站&quot;晒单分享&quot;区，与大家分享喜悦。</p><p>	</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;	</p><p><br/></p>', '0', '1', '2015-12-31 17:52:55'), ('20', '2', '常见问题', '', '1', '<h4 class=\"mat0\">1、怎样查看我参与的商品有没有中奖？</h4><p>每件商品开奖结果公布之后，登录云购网，进入&quot;我的云购中心&quot;，在&quot;我中奖的云购&quot;中即可查询中奖情况。</p><h4>2、我获得了商品，我还需要支付其他费用吗？</h4><p>不需要支付其他任何费用。</p><h4>3、当我获得商品以后我该做什么？</h4><p class=\"textindent\">在您获得商品后您会收到站内信、短信和电子邮件的通知。在这之后，您必须在“我的云购中心”正确填写、真实的收货地址，完善或确认您的个人信息。我们会在您获得商品后3个工作日内通过电话方式与您取得联系。</p><h4>4、云购网的商品是正品吗？怎么保证？</h4><p>云购网承诺，所有商品100%正品，可享受厂家所提供的全国联保服务，享受商品的保修、换货和退货的义务（国家三包政策）。</p><h4>5、如何晒单分享？</h4><p>在您收到商品后，登录云购网，进入&quot;我的云购中心&quot;，在“晒单分享”区发布晒单信息，通过审核后，您还可获得400-1500福分奖励。在您成功晒单后，您的晒单会出现在网站“晒单分享”区，与大家分享喜悦。</p><h4>6、我收到的商品可以换货或者退货吗？</h4><p>非质量问题，不在三包范围内，不给予退换货。</p><h4>7、参与1元云购需要注意什么？</h4><p>请务必正确填写真实有效的联系电话、收货地址以便在您中奖时能及时与您取得联系。</p><h4>8、网上银行充值未及时到帐怎么办？</h4><p>网上支付未及时到帐可能有以下几个原因造成：</p><p>第一，由于网速或者支付接口等问题，支付数据没有及时传送到支付系统造成的；</p><p>第二，网速过慢，数据传输超时，使银行后台支付信息不能成功对接，导致银行交易成功而支付后台显示失败；</p><p>第三，在网上支付如果使用某些防火墙软件，有时会屏蔽银行接口的弹出窗口，这时会造成在银行那边被扣费，但在我们网站上显示尚没支付。但请您放心，每天我\n们都会根据银行系统的帐务明细清单对前一天的订单进行逐笔核对，如遇问题订单，我们会做手工添加。</p><p>建议反馈</p><p>如您对我们“帮助中心”的说明有任何疑问或建议请<a href=\"http://help.1yyg.com/htm-contactus.html\">告诉我们</a></p>', '0', '3', '2015-12-31 17:52:55'), ('21', '2', '服务协议', '', '1', '<p class=\"textindent\">欢迎您访问并使用充满互动乐趣的购物网站-1元云购(www.1yyg.com)，作为为用户提供全新、有趣购物模式的互联网公司，1元云购通过在线网站\n为您提供各项相关服务。当使用1元云购的各项具体服务时，您和1元云购都将受到本服务协议所产生的制约，1元云购会不断推出新的服务，因此所有服务都将受\n此服务条款的制约。请您在注册前务必认真阅读此服务协议的内容并确认，如有任何疑问，应向1元云购咨询。一旦您确认本服务协议后，本服务协议即在用户和1\n元云购之间产生法律效力。您在注册过程中点击“同意以下条款提交注册信息”按钮即表示您完全接受本协议中的全部条款。随后按照页面给予的提示完成全部的注\n册步骤。</p><p>	</p><p class=\"textindent\">1元云购将可能不定期的修改本服务协议的有关条款，并保留在必要时对此协议中的所有条款进行随时修改的权利。一旦协议内容有所修改，1元云购将会在网站重\n要页面或社区的醒目位置第一时间给予通知。如果您继续使用1元云购的服务，则视为您受协议的改动内容。如果不同意本站对协议内容所做的修改，1元云购会及\n时取消您的服务使用权限。本站保留随时修改或中断服务而不需告知用户的权利。本站行使修改或中断服务的权利，不需对用户或第三方负责。</p><h4>一、用户注册</h4><p>1、用户注册是指用户登录1元云购，按要求填写相关信息并确认同意本服务协议的过程。</p><p>	</p><p>2、1元云购用户必须是具有完全民事行为能力的自然人，或者是具有合法经营资格的实体组织。无民事行为能力人、限制民事行为能力人以及无经营或特定经营资\n格的组织不得注册为1元云购用户或超过其民事权利或行为能力范围与1元云购进行交易，如与1元云购进行交易的，则服务协议自始无效，1元云购有权立即停止\n与该用户的交易、注销该用户账户，并有权要求其承担相应法律责任。</p><h4>二、用户的帐号，密码和安全性</h4><p class=\"textindent\">用户一旦注册成功，成为本站的合法用户。用户将对用户名和密码安全负全部责任。此外，每个用户都要对以其用户名进行的所有活动和事件负全责。用户若发现任何非法使用用户帐号或存在安全漏洞的情况，请立即通告本站。</p><h4>三、1元云购原则</h4><p>	</p><p>1、释义</p><p>云购码：指1元云购网用户成功参与云购之后获得的随机分配编码。</p><p>幸运云购码：指某件商品所有编码售出后，1元云购网根据规则计算出的一个编码，持有该编码的用户即可获得该商品。</p><p>2、1元云购网承诺遵循以下的原则运营网站，确保所有用户在1元云购网中享受同等的权利与义务。</p><p>平等原则：用户和1元云购在交易过程中具有同等的法律地位。</p><p>自由原则：用户享有自愿向1元云购参与购买商品的权利，任何人不得非法干预。</p><p>公平原则：用户和1元云购行使权利、履行义务应当遵循公平原则。</p><p>诚实信用原则：用户和1元云购行使权利、履行义务应当遵循诚实信用原则。</p><p>履行义务原则：用户向1元云购参与商品分享购买时，用户和1元云购皆有有义务根据本服务协议的约定完成该等交易（法律或本协议禁止的交易除外）</p><p>3、用户知悉，除本协议另有约定外，用户无论是否获得商品，参与云购的资金均用于帮助他人，不能退回；用户完全了解参与1元云购存在的风险，1元云购网无法保证用户参与云购一定会获得商品。</p><h4>四、用户的权利和义务</h4><p>1、用户有权拥有其在1元云购的用户名及密码，并用该用户名和密码登录1元云购参与商品购买。用户不得以任何形式转让或授权他人使用自己的1元云购用户名。</p><p>	</p><p>2、用户有权根据本协议的规定以及1元云购网站上发布的相关规则在1元云购上查询商品信息、发表使用体验、参与商品讨论、邀请关注好友、上传商品图片、参加1元云购的有关活动，以及享受1元云购提供的其它信息服务</p><p>	</p><p>3、用户有义务在注册时提供自己的真实资料，并保证诸如电子邮件地址、联系电话、联系地址、邮政编码等内容的有效性及真实性，保证1元云购可以通过上述联\n系方式与用户本人进行联系。同时，用户也有义务在相关资料发生变更时及时更新有关注册资料。用户保证不以他人资料在1元云购进行注册和参与商品分享购买。</p><p>	</p><p>4、用户应当保证在1元云购参与商品分享购买时遵守诚实信用原则，不扰乱网上交易的正常秩序。</p><p>	</p><p>5、用户在成为1元云购的会员后，可按1元云购的福分规则享受福分获得。累积福分可用于福分商城中的相应福分商品兑换。福分规则连同与该规则相关的条款和\n条件，构成用户与1元云购之间的完整协议。接受本协议，即表明接受福分规则中的条款和条件。</p><p>	</p><p>6、用户享有言论自由权利；并拥有适度修改、删除自己发表的文章的权利用户不得在1元云购发表包含以下内容的言论：</p><p>	</p><p>1) 反对宪法所确定的基本原则，煽动、抗拒、破坏宪法和法律、行政法规实施的；</p><p>	</p><p>2) 煽动颠覆国家政权，推翻社会主义制度，煽动、分裂国家，破坏国家统一的；</p><p>	</p><p>3) 损害国家荣誉和利益的；</p><p>	</p><p>4) 煽动民族仇恨、民族歧视，破坏民族团结的；</p><p>	</p><p>5) 任何包含对种族、性别、宗教、地域内容等歧视的；</p><p>	</p><p>6) 捏造或者歪曲事实，散布谣言，扰乱社会秩序的；</p><p>	</p><p>7) 宣扬封建迷信、邪教、淫秽、色情、赌博、暴力、凶杀、恐怖、教唆犯罪的；</p><p>	</p><p>8) 公然侮辱他人或者捏造事实诽谤他人的，或者进行其他恶意攻击的；</p><p>	</p><p>9) 损害国家机关信誉的；</p><p>	</p><p>10) 其他违反宪法和法律行政法规的。</p><p>	</p><p><br/></p><p><br/></p><p>7、用户在发表使用体验、讨论图片等，除遵守本条款外，还应遵守该讨论区的相关规定。</p><p>	</p><p>8、未经1元云购同意，禁止用户在网站发布任何形式的广告。</p><h4>五、1元云购的权利和义务</h4><p>1、1元云购有义务在现有技术上维护整个网上交易平台的正常运行，并努力提升和改进技术，使用户网上交易活动得以顺利进行；</p><p>	</p><p>2、对用户在注册和使用1元云购网上交易平台中所遇到的与交易或注册有关的问题及反映的情况，1元云购应及时作出回复；</p><p>	</p><p>3、对于用户在1元云购网站上作出下列行为的，1元云购有权作出删除相关信息、终止提供服务等处理，而无须征得用户的同意：</p><p>	</p><p>1) 1元云购有权对用户的注册信息及购买行为进行查阅，发现注册信息或购买行为中存在任何问