网络服务内容的所有权</h4><p class=\"textindent\">本站定义的网络服务内容包括：文字、软件、声音、图片、录象、图表、广告中的全部内容；电子邮件的全部内容；本站为用户提供的其他信息。所有这些内容受版\n权、商标、标签和其它财产所有权法律的保护。所以，用户只能在本站和广告商授权下才能使用这些内容，而不能擅自复制、再造这些内容、或创造与内容有关的派\n生产品。本站所有的文章版权归原文作者和本站共同所有，任何人需要转载本站的文章，必须征得原文作者或本站授权。</p><h4>十、用户隐私制度</h4><p class=\"textindent\">我们不会向任何第三方提供，出售，出租，分享和交易用户的个人信息。当在以下情况下，用户的个人信息将部分或全部被善意披露：</p><p>1、经用户同意，向第三方披露；</p><p>	</p><p>2、如用户是合资格的知识产权投诉人并已提起投诉，应被投诉人要求，向被投诉人披露，以便双方处理可能的权利纠纷；</p><p>	</p><p>3、根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；</p><p>	</p><p>4、如果用户出现违反中国有关法律或者网站政策的情况，需要向第三方披露；</p><p>	</p><p>5、为提供你所要求的产品和服务，而必须和第三方分享用户的个人信息；</p><p>	</p><p>6、其它本站根据法律或者网站政策认为合适的披露。</p><p>	</p><h4>十一、法律管辖和适用</h4><p>1、本协议的订立、执行和解释及争议的解决均应适用中国法律。</p><p>	</p><p>2、如发生本站服务条款与中国法律相抵触时，则这些条款将完全按法律规定重新解释，而其它合法条款则依旧保持对用户产生法律效力和影响。</p><p>	</p><p>3、本协议的规定是可分割的，如本协议任何规定被裁定为无效或不可执行，该规定可被删除而其余条款应予以执行。</p><p>	</p><p>4、如双方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向本站所在地的人民法院提起诉讼。</p><p><br/></p>', '0', '0', '2015-12-31 17:52:55'), ('22', '3', '保障体系', '', '1', '<h4 class=\"mat0\">100%正品保证</h4><p>1元云购精心挑选优质服务品牌商家，保障全场商品100%品牌正品。</p><h4>100%公平公正</h4><p>整个过程是完全透明，您可以随时查看每件商品参与人数，参与次数，参与名单及中奖信息等记录。</p><h4>全国免费快递</h4><p>1元云购承诺全场所有商品全国免费快递。（港澳台地区除外）</p><p><br/></p>', '0', '0', '2015-12-31 17:52:55'), ('23', '3', '正品保障', '', '1', '<p class=\"textindent\">1元云购严格控制供应渠道，全部商品均从品牌官方以及品牌经销商直接采购供货，并取得品牌官方网络销售授权书，如果您认为云购的商品是假货，并能提供国家\n相关质检机构的证明文件，经确认后，在返还商品金额的同时并提供假一赔十服务保障。为了保障您的利益，对云购的商品，做如下说明：</p><p>	</p><p class=\"bottom-space16px\">1、1元云购对所有商品均保证正品行货，正规渠道发货，所有商品都可以享受生产厂家的全国联保服务，按照国家三包政策，针对所售商品履行保修、换货和退货的义务。</p><p>	</p><p class=\"bottom-space16px\">2、出现国家三包所规定的功能性故障时，经由生产厂家指定或特约售后服务中心检测确认故障属实，您可以选择换货或者维修；超过15日且在保修期内，您只能\n在保修期内享受免费维修服务。为了不耽误您使用，缩短故障商品的维修时间，我们建议您直接联系生产厂家售后服务中心进行处理。您也可以直接在商品的保修卡\n中查找该商品对应的全国各地生产厂家售后服务中心联系处理。</p><p>	</p><p class=\"bottom-space16px\">3、1元云购真诚提醒广大幸运者在您收到商品的时候，请尽量亲自签收并当面拆箱验货，如果有问题(运输途中的损坏)请不要签收!与快递员交涉，拒签，退回!</p><p>	</p><p class=\"bottom-space16px\">4、在收到商品后发现有质量问题，请您不要私自处理，妥善保留好原包装，第一时间联系1元云购客服人员，由1元云购同发货商城协商在48小时内解决。如有破损或丢失，我们将无法为您办理退货。</p><p>	</p><p class=\"textindent\">如对协商处理结果存在异议，请您自行到当地生产厂家售后服务中心进行检测，并开据正规检测报告（对于有些生产厂家售后服务中心无法提供检测报告的，需提供\n维修检验单据），如果检测报告确认属于质量问题，然后将检测报告、问题商品及完整包装附件，一并返还发货商城办理换货手续，产生的相关费用由1元云购追究\n相关责任方承担。</p><p>	</p><p class=\"textindent\">1元云购上的电子产品及配件因为生成工艺或仓储物流原因，可能会存在收到或使用过程中出现故障的几率，1元云购不能保证所有的商品都没有故障，但我们保证\n所售商品都是全新正品行货，能够提供正规的售后保障。我们保证商品的正规进货渠道和质量，如果您对收到的商品质量表示怀疑，请提供生产厂家或官方出具的书\n面鉴定，我们会按照国家法律规定予以处理。但对于任何欺诈性行为，1元云购将保留依法追究法律责任的权利。本规则最终解释权由1元云购所有。</p><p><br/></p>', '0', '0', '2015-12-31 17:52:55'), ('24', '3', '安全支付', '', '1', '<p>1元云购作为平安银行、网银在线、快钱、银联在线支付、财付通的认证商家，严格遵循网络购物的安全准则，通过网银在线、快钱、银联在线支付、财付通等安全度高的支付方式，充分保证您在线支付的安全性。</p>', '0', '0', '2015-12-31 17:52:55'), ('25', '4', '商品配送', '', '1', '<p class=\"textindent\">在您获得商品后，1元云购将在第一时间内免费为你寄出，一般采用签约快递，均为服务好，覆盖网点非常广泛的全国性快递公司或者邮政的EMS，以最大限度保证商品安全。如快递公司无法达到的地方，则使用邮政EMS为您寄送商品。</p><p class=\"textindent\">若遇商品暂时缺货或者是有其他方面的问题，1元云购客服将会及时与您沟通处理。</p><p><br/></p>', '0', '0', '2015-12-31 17:52:55'), ('26', '4', '配送费用', '', '1', '<p>	</p><p>所有商品全国免费配送。（港澳地区除外）</p>', '0', '0', '2015-12-31 17:52:55'), ('27', '4', '验货签收', '', '1', '<p>	</p><p class=\"bottom-space16px\">1、您在签收商品时请慎重，请尽量不要让人代签，并务必先仔细检查商品（外包装是否被开封、商品是否破损、配件是否缺失、功能是否正常），确保无误后再签\n收，以免产生不必要的纠纷。若有任何疑问，请及时拨打客服电话反馈信息。若因用户未仔细检查商品即签收后产生的纠纷，1元云购概不负责，仅承担协调处理的\n义务。</p><p><br/></p><p class=\"bottom-space16px\">2、若因您的地址填写错误、联系方式填写有误等情况造成商品无法完成投递或被退回，所产生的额外费用及后果由用户负责。</p><p><br/></p><p>3、如因不可抗拒的自然原因（地震、洪水等等）所造成的商品配送延迟，1元云购不承担责任。</p><p><br/></p><h4>温馨提醒</h4><p class=\"textindent\">若您或您的委托人已签收，则说明订单商品正确无误且不存在影响使用的因素，1元云购有权不受理因包装或商品破损、商品错漏发、商品表面质量问题、商品附带品及赠品少发为由的换货申请。</p><p><br/></p>', '0', '0', '2015-12-31 17:52:55'), ('28', '16', '基金去向', '', '1', '<p>云购基金将会以第1种途径或第2种途径进行使用：<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1、1元云购全体员工将组织向身边的公益事业进行捐赠与关怀活动。活动内容包括：资金、所需用品以及探望与协助等，每次捐赠与关怀活动结束后云购基金将公布活动详情以及基金详细使用报告。<br/> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2、云购基金通过腾讯公益或壹基金等公益组织进行爱心捐赠。</p>', '52', '1', '2015-12-31 17:52:55'), ('29', '16', '建立基金', '', '1', '<p>云购基金是1元云购创始人发起成立的以公益事业为主要方向的爱心基金。云购基金本着“我为人人，人人为我”的社会责任，向需要帮助的困难人们提供爱心捐助。</p>', '57', '1', '2015-12-31 17:52:55'), ('30', '16', '基金筹款', '', '1', '<p>每位在1元云购进行分享购物的朋友，您的每次参与都将是为我们的公益事业做出一份贡献。当您每参与1人次云购，将由1元云购出资为云购基金筹款0.01元，所筹款项将全部用于云购基金。</p>', '57', '1', '2015-12-31 17:52:55'), ('1', '0', '了解云购', '', '1', 'sp; &nbsp;	</p><h3 style=\"padding-left:22px; margin-top:0;\">注：</h3><p style=\"margin-bottom:10px; margin-top:5px; text-indent:1.6em;\">1）商品揭晓后您可登录&quot;我的1元云购&quot;查询详情，未获得商品的用户不会收到短信或邮件通知；</p><p style=\"margin-bottom:10px; margin-top:5px; text-indent:1.6em;\">2）商品揭晓后，请及时登录&quot;我的1元云购&quot;完善个人资料，以便我们能够准确无误地为您配送商品。</p><p style=\"margin-bottom:10px; margin-top:5px; text-indent:1.6em;\">3）所有已揭晓商品均不给予退款</p><p><strong>4、晒单分享</strong><br/>	</p><p style=\"margin-top:5px;\">晒出您收到的商品实物图片甚至您的靓照，说出您的云购心得，让大家一起分享您的快乐。</p><p>	</p><p>在您收到商品后，您只需登录网站完成晒单，并通过审核，即可获得400-1500福分奖励。在您成功晒单后，您的晒单会出现在网站&quot;晒单分享&quot;区，与大家分享喜悦。</p><p>	</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;	</p><p><br/></p>', null, '0', '0000-00-00 00:00:00');
