-- ----------------------------
--  Table structure for `yyg_order`
-- ----------------------------
DROP TABLE IF EXISTS `yyg_order`;
CREATE TABLE `yyg_order` (
  `oid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(20) DEFAULT NULL COMMENT '订单号',
  `uid` int(10) unsigned DEFAULT NULL COMMENT '用户id',
  `gid` int(10) unsigned NOT NULL COMMENT '商品ID',
  `gtype` tinyint(3) unsigned NOT NULL COMMENT '商品类型',
  `qishu` int(11) DEFAULT NULL COMMENT '期数',
  `gdtitle` varchar(255) DEFAULT NULL COMMENT '商品标题',
  `gdsubtitle` varchar(255) DEFAULT NULL COMMENT '商品副标题',
  `count` int(10) unsigned DEFAULT NULL COMMENT '数量',
  `danjia` varchar(45) DEFAULT NULL COMMENT '单价',
  `chujia` decimal(10,0) DEFAULT NULL COMMENT '出价',
  `money` decimal(8,0) DEFAULT NULL COMMENT '付款金额',
  `prizecode` varchar(45) DEFAULT NULL COMMENT '中奖码',
  `paytype` varchar(10) DEFAULT NULL COMMENT '付款方式',
  `ip` varchar(255) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL COMMENT '订单状态：-1:废弃/0:/未付款／1:未发货/2:已发货／3:待收货／4:已完成',
  `sheng` varchar(15) DEFAULT NULL COMMENT '省',
  `shi` varchar(15) DEFAULT NULL COMMENT '市',
  `xian` varchar(15) DEFAULT NULL COMMENT '县／地区',
  `jiedao` varchar(255) DEFAULT NULL COMMENT '街道',
