-- ----------------------------
DROP TABLE IF EXISTS `yyg_paimai`;
CREATE TABLE `yyg_paimai` (
  `gid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '秒杀ID',
  `cid` int(11) unsigned DEFAULT NULL COMMENT '商品分类',
  `bid` int(10) unsigned DEFAULT NULL COMMENT '品牌',
  `title` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '标题',
  `subtitle` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '副标题',
  `description` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `thumb` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '缩略图',
  `content` text COLLATE utf8_bin COMMENT '详情url',
  `qipaijia` int(11) DEFAULT NULL COMMENT '起拍价',
  `jiafujia` int(11) DEFAULT NULL COMMENT '加幅价',
  `baoliujia` int(11) DEFAULT '0' COMMENT '保留价',
  `lijijia` int(10) unsigned DEFAULT '0' COMMENT '立即揭标价',
  `baozhengjin` int(11) DEFAULT NULL COMMENT '保证金',
  `chujiazhe` int(10) unsigned DEFAULT '0' COMMENT '最高出价者id',
  `zuigaojia` int(11) DEFAULT '0' COMMENT '最高价',
  `chujiacishu` int(11) DEFAULT '0' COMMENT '出价次数',
  `type` tinyint(1) DEFAULT '3' COMMENT '1:一元购 2：限购专区，3:拍卖专区',
  `baoyou` tinyint(4) DEFAULT '0' COMMENT '包邮(0:否,1是)',
  `renqi` tinyint(4) DEFAULT '0' COMMENT '人气',
  `tuijian` tinyint(4) DEFAULT '0' COMMENT '推荐',
  `status` tinyint(4) DEFAULT '0' COMMENT '状态(0新增,1购买中,2结束)',
  `liji` tinyint(3) unsigned DEFAULT '0' COMMENT '是否立即揭标结束的标记（0:否，1:是)',
  `sort` int(11) DEFAULT '0' COMMENT '排序',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `prizeuid` int(10) unsigned DEFAULT NULL COMMENT '中奖者',
  PRIMARY KEY (`gid`)
) ENGINE=InnoDB AUTO_INCREMENT=252 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='商品列表';

