b(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;一、用户注册&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1、用户注册是指用户登录一元云购，按要求填写相关信息并确认同意本服务协议的过程。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2、一元云购用户必须是具有完全民事行为能力的自然人，或者是具有合法经营资格的实体组织。无民事行为能力人、限制民事行为能力人以及无经营或特定经营资格的组织不得注册为一元云购用户或超过其民事权利或行为能力范围与一元云购进行交易，如与一元云购进行交易的，则服务协议自始无效，一元云购有权立即停止与该用户的交易、注销该用户账户，并有权要求其承担相应法律责任。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;二、用户的帐号，密码和安全性&lt;/h3&gt;&lt;p class=&quot;Service_em&quot; style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;用户一旦注册成功，成为本站的合法用户。用户将对用户名和密码安全负全部责任。此外，每个用户都要对以其用户名进行的所有活动和事件负全责。用户若发现任何非法使用用户帐号或存在安全漏洞的情况，请立即通告本站。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;三、一元云购原则&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;平等原则：用户和一元云购在交易过程中具有同等的法律地位。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;自由原则：用户享有自愿向一元云购参与购买商品的权利，任何人不得非法干预。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;公平原则：用户和一元云购行使权利、履行义务应当遵循公平原则。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;诚实信用原则：用户和一元云购行使权利、履行义务应当遵循诚实信用原则。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;履行义务原则：用户向一元云购参与商品分享购买时，用户和一元云购皆有有义务根据本服务协议的约定完成该等交易（法律或本协议禁止的交易除外）&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;四、用户的权利和义务&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1、用户有权拥有其在一元云购的用户名及密码，并用该用户名和密码登录一元云购参与商品购买。用户不得以任何形式转让或授权他人使用自己的一元云购用户名。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2、用户有权根据本协议的规定以及一元云购网站上发布的相关规则在一元云购上查询商品信息、发表使用体验、参与商品讨论、邀请关注好友、上传商品图片、参加一元云购的有关活动，以及享受一元云购提供的其它信息服务&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;3、用户有义务在注册时提供自己的真实资料，并保证诸如电子邮件地址、联系电话、联系地址、邮政编码等内容的有效性及真实性，保证一元云购可以通过上述联系方式与用户本人进行联系。同时，用户也有义务在相关资料发生变更时及时更新有关注册资料。用户保证不以他人资料在一元云购进行注册和参与商品分享购买。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;4、用户应当保证在一元云购参与商品分享购买时遵守诚实信用原则，不扰乱网上交易的正常秩序。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;5、用户在成为一元云购的会员后，可按一元云购的福分规则享受福分获得。累积福分可用于福分商城中的相应福分商品兑换。福分规则连同与该规则相关的条款和条件，构成用户与一元云购之间的完整协议。接受本协议，即表明接受福分规则中的条款和条件。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;6、用户享有言论自由权利；并拥有适度修改、删除自己发表的文章的权利用户不得在一元云购发表包含以下内容的言论：&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1) 反对宪法所确定的基本原则，煽动、抗拒、破坏宪法和法律、行政法规实施的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2) 煽动颠覆国家政权，推翻社会主义制度，煽动、分裂国家，破坏国家统一的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;3) 损害国家荣誉和利益的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;4) 煽动民族仇恨、民族歧视，破坏民族团结的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;5) 任何包含对种族、性别、宗教、地域内容等歧视的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;6) 捏造或者歪曲事实，散布谣言，扰乱社会秩序的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;7) 宣扬封建迷信、邪教、淫秽、色情、赌博、暴力、凶杀、恐怖、教唆犯罪的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;8) 公然侮辱他人或者捏造事实诽谤他人的，或者进行其他恶意攻击的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;9) 损害国家机关信誉的；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;10) 其他违反宪法和法律行政法规的。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;7、用户在发表使用体验、讨论图片等，除遵守本条款外，还应遵守该讨论区的相关规定。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;8、未经一元云购同意，禁止用户在网站发布任何形式的广告。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;五、一元云购的权利和义务&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1、一元云购有义务在现有技术上维护整个网上交易平台的正常运行，并努力提升和改进技术，使用户网上交易活动得以顺利进行；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2、对用户在注册和使用一元云购网上交易平台中所遇到的与交易或注册有关的问题及反映的情况，一元云购应及时作出回复；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;3、对于用户在一元云购网站上作出下列行为的，一元云购有权作出删除相关信息、终止提供服务等处理，而无须征得用户的同意：&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1) 一元云购有权对用户的注册信息及购买行为进行查阅，发现注册信息或购买行为中存在任何问题的，有权向用户发出询问及要求改正的通知或者作出删除等处理；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2) 用户违反本协议规定或有违反法律法规和地方规章的行为的，一元云购有权停止传输并删除其信息，禁止用户发言，注销用户账户并按照相关法律规定向相关主管部门进行披露。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;3) 对于用户在一元云购进行的下列行为，一元云购有权对用户采取删除其信息、禁止用户发言、注销用户账户等限制性措施：包括发布或以电子邮件或以其他方式传送存在恶意、虚假和侵犯他人人身财产权利内容的信息，进行与分享购物无关或不是以分享购物为目的的活动，恶意注册、签到、评论等方式试图扰乱正常购物秩序，将有关干扰、破坏或限制任何计算机软件、硬件或通讯设备功能的软件病毒或其他计算机代码、档案和程序之资料，加以上载、发布、发送电子邮件或以其他方式传送，干扰或破坏一元云购网站和服务或与一元云购网站和服务相连的服务器和网络，或发布其他违反公共利益或可能严重损害一元云购和其它用户合法利益的信息。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;4、用户在此免费授予一元云购永久性的独家使用权(并有权对该权利进行再授权)，使一元云购有权在全球范围内(全部或部分地)使用、复制、修订、改写、发布、翻译和展示用户公示于一元云购网站的各类信息，或制作其派生作品，和或以现在已知或日后开发的任何形式、媒体或技术，将上述信息纳入其它作品内。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;5、对于一元云购网络平台已上架商品，一元云购有权根据市场变动修改商品价格，而无需提前通知客户。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;6、一元云购分享购物模式，秉着双方自愿原则，分享购物存在风险，一元云购不对抽取的“幸运编号”结果承担责任，望所有用户谨慎参与。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;7、90天未达到“总需参与人次”的商品，用户可通过客服申请退款，所退款项将在3个工作日内，退还至云购账户中。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;六、配送及费用&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;一元云购将会把产品送到您所指定的送货地址。全国免费配送（港澳台地区除外）。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;请清楚准确地填写您的真实姓名、送货地址及联系方式。因如下情况造成配送延迟或无法配送等，本站将不承担责任：&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1、客户提供错误信息和不详细的地址；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2、货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果。&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;3、不可抗力，例如：自然灾害、交通戒严、突发战争等。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;七、商品缺货规则&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;用户通过参与一元云购所获得的商品如果发生缺货，用户和一元云购皆有权取消该交易，所花费的款一元云购将全部返还。或一元云购对缺货商品进行预售登记，一元云购会尽最大努力在最快时间内满足用户的购买需求，当缺货商品到货，一元云购将第一时间通过邮件、短信或电话通知用户，方便用户进行购买。预售登记并不做交易处理，不构成要约。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;八、责任限制&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;在法律法规所允许的限度内，因使用一元云购服务而引起的任何损害或经济损失，一元云购承担的全部责任均不超过用户所购买的与该索赔有关的商品价格。这些责任限制条款将在法律所允许的最大限度内适用，并在用户资格被撤销或终止后仍继续有效。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;九、网络服务内容的所有权&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;本站定义的网络服务内容包括：文字、软件、声音、图片、录象、图表、广告中的全部内容；电子邮件的全部内容；本站为用户提供的其他信息。所有这些内容受版权、商标、标签和其它财产所有权法律的保护。所以，用户只能在本站和广告商授权下才能使用这些内容，而不能擅自复制、再造这些内容、或创造与内容有关的派生产品。本站所有的文章版权归原文作者和本站共同所有，任何人需要转载本站的文章，必须征得原文作者或本站授权。&lt;/p&gt;&lt;h3 style=&quot;font: bold 14px/normal tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 10px; text-align: left; color: rgb(153, 153, 153); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;十、用户隐私制度&lt;/h3&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;我们不会向任何第三方提供，出售，出租，分享和交易用户的个人信息。当在以下情况下，用户的个人信息将部分或全部被善意披露：&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;1、经用户同意，向第三方披露；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;2、如用户是合资格的知识产权投诉人并已提起投诉，应被投诉人要求，向被投诉人披露，以便双方处理可能的权利纠纷；&lt;/p&gt;&lt;p style=&quot;font: 12px/24px tahoma, arial, &amp;quot;Hiragino Sans GB&amp;quot;, 宋体, sans-serif; margin: 0px; padding: 0px 0px 5px; color: rgb(153, 153, 153); text-transform: none; text-indent: 2em; letter-spacing: normal; word-spacing: 0px; white-space: normal; widows: 1; font-size-adjust: none; font-stretch: normal; -webkit-text-stroke-width: 0px;&quot;&gt;3、根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', null, '/Public/P/images/other/goods.jpg', '1', '0', '2015-12-28 11:55:54');
COMMIT;

